import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';
import Sec1 from './components/Section1';
import Sec2 from './components/Section2';
import productCard from './components/productCard';

function App() {
  return (
    <>
      <Header/>
      <Navbar/>
      <Sec1/>
      <Sec2/>
      <productCard/>
    </>

  );
}

export default App;
